script: |
  super -f text -I q12090.spq | sort > q12090.out

inputs:
  - name: q12090.spq
    data: |
      SELECT ALL + + col2 - - - col0 + + - col0 + 35 * CAST ( NULL AS REAL ) AS col2 FROM tab2 (FORMAT parquet) cor0 WHERE NOT NULL <> - 53;
  - name: tab2

outputs:
  - name: q12090.out
    data: |
